import React from 'react'
import { NavLink } from "react-router-dom";
import ProjectImg from '../images/modernism.jpg';
function Project() {
    return (
        <>
            <div className='main_project'>
                <div className='central_project'>
                    <div className="gallery">
                        <NavLink target="_blank" to="/">
                            <img src={ProjectImg} alt="Cinque Terre" width="600" height="400" />
                        </NavLink>
                        <div className="desc">Add NavLink description of the image here</div>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Project
